const ShopModule = () => import('./ShopModule.vue');
const ShopPage = () => import('./views/ShopPage.vue');


const moduleRoute = {
    path: "/mypanel/service/profile/:id",
    component: ShopModule,

    children:[{
        path: "/mypanel/service/profile/:id",
        component: ShopPage,
    }]
}

export default router => {
    router.addRoute(moduleRoute);
}
